import { Game } from "../../../model/games.model";
import React from "react";
import style from "/GamesListItem.module.css"
import { Card } from "@mui/material";

interface PageProps {
    game: Game
}

export const GamesListItem: React.FC<PageProps> = ({game}) => {
  return (
    <Card>
      <h1>{game.title}</h1>
    </Card>
  );
};
